import React, { Component } from "react";
import axios from "axios";
import {Button, Form, FormGroup, Input, Label} from "reactstrap";



class AddMedicineOrder extends Component {

    constructor(props) {
        super(props);
        this.state = {
            customer: {
                id: null,
                name: "",
                surname: "",
                age: null
            },
            orderItems: []
        };
    }

    render () {
        return (
            <div>
                <h3>
                    Dodaj nowe zam√≥wienie
                </h3>
                <h6>
                    Podsumowanie:
                </h6>
                <p>
                    Customer: {this.state.customer.name} {this.state.customer.surname}
                </p>
                <span>
                    <Form>
                        <FormGroup>
                            <Label for="customerName">Search customer</Label>
                            <Input
                                type="text"
                                name="customerName"
                                onChange={this.handleCustomerSearchChange}
                                placeholder="Enter customer name"
                            />
                        </FormGroup>
                    </Form>
                    <Button color="primary" onClick={this.onCustomerSearchSubmit}>
                        Search
                    </Button>
                    <div>
                        <h6>Results:</h6>

                    </div>
                </span>
            </div>
        );
    }

}

export default AddMedicineOrder;
